import React, { Component } from 'react'
import { NavLink, Redirect } from 'react-router-dom'; 
import AuthContext from '../components/context/AuthContext'
import { orderApi } from '../components/misc/OrderApi'
import { parseJwt, handleLogError } from '../components/misc/Helpers'
import { Button, Label, Input } from '@windmill/react-ui';

class SignUp extends Component {
  static contextType = AuthContext;

  state = {
    username: '',
    password: '',
    name: '',
    email: '',
    isLoggedIn: false,
    isError: false,
    errorMessage: ''
  }

  componentDidMount() {
    const Auth = this.context;
    const isLoggedIn = Auth.userIsAuthenticated();
    this.setState({ isLoggedIn });
  }

  handleInputChange = (e) => {
    this.setState({ [e.target.name]: e.target.value })
  }

  handleSubmit = (e) => {
    e.preventDefault()

    const { username, password, name, email } = this.state
    if (!(username && password && name && email)) {
      this.setState({
        isError: true,
        errorMessage: 'Please, inform all fields!'
      })
      return
    }

    const user = { username, password, name, email }
    orderApi.signup(user)
      .then(response => {
        const { accessToken } = response.data
        const data = parseJwt(accessToken)
        const user = { data, accessToken }

        const Auth = this.context
        Auth.userLogin(user)

        this.setState({
          username: '',
          password: '',
          isLoggedIn: true,
          isError: false,
          errorMessage: ''
        })
      })
      .catch(error => {
        handleLogError(error)
        if (error.response && error.response.data) {
          const errorData = error.response.data
          let errorMessage = 'Invalid fields'
          if (errorData.status === 409) {
            errorMessage = errorData.message
          } else if (errorData.status === 400) {
            errorMessage = errorData.errors[0].defaultMessage
          }
          this.setState({
            isError: true,
            errorMessage
          })
        }
      })
  }

  render() {
    const { isLoggedIn, isError, errorMessage } = this.state

    if (isLoggedIn) {
      return <Redirect to='/app' />
    } else {
      return (
        <div className="flex items-center min-h-screen p-6 bg-gray-50 dark:bg-gray-900">
          <div className="flex-1 h-full max-w-4xl mx-auto overflow-hidden bg-white rounded-lg shadow-xl dark:bg-gray-800">

              <main className="flex items-center justify-center p-6 sm:p-12 md:w-1/2">
                <div className="w-full">
                  <h1 className="mb-4 text-xl font-semibold text-gray-700 dark:text-gray-200">
                    Create account
                  </h1>
                  <Label>
                    <span>Email</span>
                    <Input className="mt-1" type="email" placeholder="john@doe.com" name="email" onChange={this.handleInputChange} />
                  </Label>
                  <Label className="mt-4">
                    <span>Password</span>
                    <Input className="mt-1" placeholder="***************" type="password" name="password" onChange={this.handleInputChange} />
                  </Label>
                  <Label className="mt-4">
                    <span>Name</span>
                    <Input className="mt-1" placeholder="Your Name" name="name" onChange={this.handleInputChange} />
                  </Label>
                  <Label className="mt-4">
                    <span>Username</span>
                    <Input className="mt-1" placeholder="Username" name="username" onChange={this.handleInputChange} />
                  </Label>
                  <Label className="mt-4">
                    <span>Username</span>
                    <Input className="mt-1" placeholder="Username" name="username" onChange={this.handleInputChange} />
                  </Label>

                  <Button className="mt-4" block onClick={this.handleSubmit}>
                    Signup
                  </Button>

                  <hr className="my-8" />

                  <p className="mt-4">
                    <NavLink
                      className="text-sm font-medium text-purple-600 dark:text-purple-400 hover:underline"
                      to="/login"
                    >
                      Already have an account? Login
                    </NavLink>
                  </p>
                  {isError && <p className="mt-2 text-red-500">{errorMessage}</p>}
                </div>
              </main>
            </div>
          </div>
      )
    }
  }
}

export default SignUp;
